import React from 'react';
import {Box, Heading, position, SimpleGrid, Stack, Text,FooterHeading,Link} from "@chakra-ui/react";
const Footer = () => {
    return (
      <Box minH={'40vh'} bg={'#2D3748'}>
          <SimpleGrid columns={4} spacing={10} p={4}>
              <Box minW="130px">
                  <FooterHeading mb="4">Product</FooterHeading>
                  <Stack>
                      <Link>How it works</Link>
                      <Link>Pricing</Link>
                      <Link>Use Cases</Link>
                  </Stack>
              </Box>
              <Box minW="130px">
                  <FooterHeading mb="4">Legal</FooterHeading>
                  <Stack>
                      <Link>Privacy</Link>
                      <Link>Terms</Link>
                      <Link>License</Link>
                  </Stack>
              </Box>
          </SimpleGrid>
      </Box>
    );
};

export default Footer;
